pragma solidity >=0.4.22 <0.9.0;
// SPDX-License-Identifier: MIT
import "./tokens/nf-token-metadata.sol";
import "./ownable.sol";

contract NftCreate is NFTokenMetadata, Ownable {
  uint totalNfts =0;
  struct NFTdetail{
    string NFTname;
    address ownerAddress;
    uint256 tokenId;
  }
  NFTdetail[] nftlist ;
  constructor() {
   // nftName;
    nftSymbol = "SYN";
  }
  mapping (uint256 => NFTdetail) infomap;
  function mint(string memory _name,address _to, uint256 _tokenId, string calldata _uri) external onlyOwner {
   // nftName = _name;
    super._mint(_to, _tokenId);
    super._setTokenUri(_tokenId, _uri);
    nftlist.push(NFTdetail(_name,_to,_tokenId));
    infomap[_tokenId] = NFTdetail(_name,_to,_tokenId);
    totalNfts++;
  }
  function getAddress(uint256 _tokenId) public view returns (address){
    return infomap[_tokenId].ownerAddress;
  }
  function getLength() public view returns(uint){
    return totalNfts;
  }
  function getDetails(uint256 _tokenId) public view returns (string memory, address ){

      return (infomap[_tokenId].NFTname,infomap[_tokenId].ownerAddress);

  }

}

